import Head from 'next/head';
import { Fragment, useS } from 'react';
import paths from '../../paths';
import HeroSection from '../../components/hero/heroDashboard';

const DashboardIndex = ({
  currentUser,
  tickets,
  title = 'Welcome to Ticket Market!',
}) => {
  const [ticketsList] = useState([ticket.title]);

  return (
    <Fragment>
      <Head>
        <title>{title}</title>
      </Head>
      <HeroSection ticketsList={ticketsList} />
    </Fragment>
  );
};

